import React from 'react';
import './MoviesCardlist.css';
import MoviesCard from "../MoviesCard";

const MoviesCardlist = () => {
    return (
        <section className="movies-container">
            <div className="movies">

                <MoviesCard/>
                  
            </div>
        </section>
);
};

export default MoviesCardlist;
